    if (users.length > 0)
    return (
        <div>
            {users.map((user) => (<div key={user.id}>
                <h3>{user.firstname} {user.lastname}</h3>
                <p>{user.bio}</p>
                <p>{user.age}</p>
            </div>))}
        </div>
    )  

    else return (
        <div>
            ПУСТО
        </div>
    )  
  }
  
export default Users
